import MenuItem from "./Menuitem";
const menuItems = ["Home", "Recent winners", "How to Play", "FAQs"];
function Menu() {
    return (
        <div className="menu">
            {menuItems.map((item) => {
                return (
                    <MenuItem key={item.toString()} item={item} />
                )
            })}

        </div>
    );
}

export default Menu;
